(14, 'Biaya Kuliah UIN Syarif Hidayatullah Jakarta 2019', 'Perguruan tinggi keagamaan di bawah naungan Kementerian Agama sudah mengadopsi sistem pembiayaan kuliah dengan uang kuliah tunggal (UKT). UKT terdiri dari beberapa kelompok yang ditentukan berdasarkan kemampuan ekonomi mahasiswa, orang tua mahasiswa, atau pihak lain yang membiayainya.', 'Perguruan tinggi keagamaan di bawah naungan Kementerian Agama sudah mengadopsi sistem pembiayaan kuliah dengan uang kuliah tunggal (UKT). UKT terdiri dari beberapa kelompok yang ditentukan berdasarkan kemampuan ekonomi mahasiswa, orang tua mahasiswa, atau pihak lain yang membiayainya.\r\n\r\nMahasiswa hanya dibebankan satu macam biaya yakni UKT yang dibayarkan per semester. Keputusan Menteri Agama no 151 tahun 2019 menegaskan bahwa perguruan tinggi keagamaan negeri dilarang memungut uang pangkal dan pungutan lain selain UKT dari mahasiswa baru program diploma dan program sarjana.\r\n\r\nBiaya kuliah atau UKT Universitas Islam Negeri UIN Syarif Hidayatullah Jakarta dibagi menjadi 7 kelompok UKT. Mahasiswa yang dinyatakan lulus seleksi wajib melakukan registrasi dan mengisi formulir Uang Kuliah Tunggal dan melengkapi data dakung yang akan menjadi dasar penenttuan kelompok UKT.\r\n\r\nData atau dokumen pendukung yang perlu dipersiapkan antara lain:\r\n\r\nScan Slip Gaji kedua orang tua atau Surat Keterangan Penghasilan dari RT/RW yang diketahui oleh Lurah/Kepala Desa Setempat.\r\nScan Kartu Keluarga.\r\nScan Surat Keterangan Tidak Mampu/Kartu Menuju Sejahtera/Program Keluarga Harapan (jika ada).\r\nScan photo rumah tampak luar dan dalam.\r\nScan bukti pembayaran Pajak Bumi dan Bangunan.\r\nScan bukti pembayaran Rekening Tagihan Listrik atau Pembelian Token Listrik; dan\r\nScan STNK kendaraan.\r\nProses Penentuan UKT:\r\n\r\nPilihan A\r\n– Calon Mahasiswa tidak perlu mengisi formulir UKT dan tidak mengupload data dukung UKT.\r\n– Melakukan download Surat Pernyataan Kesediaan Membayar UKT Kelompok 7.\r\n– Melakukan upload Surat Pernyataan Kesediaan Membayar UKT Kelompok 7 yang telah diberi meterai 6000 dan ditandatangani orang tua/wali (format jpeg, Kemudian Log Out).\r\n– Login UKT kembali dan cetak Hasil Kelompok UKT.\r\n– Membayar UKT dengan menggunakan nomor peserta ujian pada Bank mitra UIN Syarif Hidayatullah Jakarta.\r\nPilihan B\r\n– Calon Mahasiswa mengisi formulir UKT online.\r\n– Melakukan upload data pendukung UKT (format jpeg).\r\n– Melakukan download formulir UKT yang telah diisi.\r\n– Melakukan upload formulir UKT yang telah diberi materai 6000 dan ditandangani orang tua mahasiswa/wali.\r\n– Mengakses pengumuman Hasil Kelompok UKT pada menu “Login Proses UKT dan Pengumuman Kelompok UKT” dengan melakukan cetak Hasil Kelompok UKT.\r\n– Jika setuju langsung melakukan pembayaran UKT dengan menggunakan nomor peserta ujian pada Bank mitra UIN Syarif Hidayatullah Jakarta.\r\n– Jika tidak setuju melakukan proses klarifikasi data pendukung UKT.\r\n– Mahasiswa menerima hasil klarifikasi UKT, kemudian membayar UKT dengan menggunakan nomor peserta ujian pada Bank mitra UIN Syarif Hidayatullah Jakarta.\r\nPilihan C\r\n– Calon Mahasiswa telah terdaftar sebagai mahasiswa kerjasama dengan UIN Syarif Hidayatulllah Jakarta.\r\n– Mengakses pengumuman Hasil Kelompok UKT pada menu “Login Proses UKT dan Pengumuman Kelompok UKT”.\r\n– Membayar UKT dengan menggunakan nomor peserta ujian pada Bank mitra UIN Syarif Hidayatullah Jakarta', '1616158058 . uin-syarif-hidayatullah-jakarta.jpg', '2021-03-19 12:47:38', '2021-03-19 12:47:38'),
(17, 'Elon Musk', 'Elon Musk co-founded and leads Tesla, SpaceX, Neuralink and The Boring Company.\r\n\r\nAs the co-founder and CEO of Tesla, Elon leads all product design, engineering and global manufacturing of the company\'s electric vehicles, battery products and solar energy products.', 'Elon Musk co-founded and leads Tesla, SpaceX, Neuralink and The Boring Company.\r\n\r\nAs the co-founder and CEO of Tesla, Elon leads all product design, engineering and global manufacturing of the co<b>mpany\'s electric vehicles, battery products and solar energy products.\r\n\r\nSince the company’s inception in 2003, Tesla’s mission has been to accelerate the world’s transition to sustainable energy. The first Tesla product, the Roadster sports car, debuted in 2008, followed by the Model S sedan, which was introduced in 2012, and the Model X SUV, which launched in 2015. Model S received Consumer Reports’ Best Overall Car and has been named the Ultimate Car of the Year by Motor Trend, while Model X was the first SUV ever to earn 5-star safety ratings in every category and su</b>b-category in the National Highway Traffic Safety Administration’s tests. In 2017, Tesla began deliveries of Model 3, a mass-market electric vehicle with more than 320 miles of range, and unveiled Tesla Semi, which is designed to save owners at least $200,000 over a million miles based on fuel costs alone. In 2019, Tesla unveiled Cybertruck, which will have better utility than a traditional truck and more performance than a sports car, as well as the Model Y compact SUV, which began customer deliveries in early 2020.\r\n\r\nTesla also produces three energy storage products, the Powerwall home battery, the Powerpack commercial-scale battery, and Megapack, which is designed for utility-scale installations. In 2016, Tesla became the world’s first vertically-integrated sustainable energy company with the acquisition of SolarCity, the leading provider of solar power systems in the United States, and in 2017 released Solar Roof – a beautiful and affordable energy generation product.\r\n\r\nAs lead designer at SpaceX, Elon oversees the development of rockets and spacecraft for missions to Earth orbit and ultimately to other planets. In 2008, the SpaceX Falcon 1 was the first privately developed liquid fuel rocket to reach orbit, and SpaceX made further history in 2017 by re-flying both a Falcon 9 rocket and Dragon spacecraft for the first time. Soon after, Falcon Heavy, the most powerful operational rocket in the world by a factor of two, completed its first flight in 2018. In 2019, SpaceX’s crew-capable version of the Dragon spacecraft completed its first demonstration mission, and the company will fly NASA astronauts to the International Space Station for the first time in 2020. Building on these achievements, SpaceX is developing Starship – a fully reusable transportation system that will carry crew and cargo to the Moon, Mars and beyond ­– and Starlink, which will deliver high speed broadband internet to locations where access has been unreliable, expensive, or completely unavailable. By pioneering reusable rockets, SpaceX is pursuing the long-term goal of making humans a multi-planet species by creating a self-sustaining city on Mars.', '1616862409 . elon.jpg', '2021-03-27 11:33:08', '2021-03-27 16:26:49'),
(19, 'Cara Terbaik Putus Hubungan Berdasarkan Zodiak si Dia', 'Putus cinta memang bukan persoalan mudah. Tak hanya menghadapi dampaknya, membicarakan dan menyampaikan keinginan untuk mengakhiri hubungan jelas tidak mudah.', '<h3><strong>1. Aries -&nbsp;<em>To the point</em>&nbsp;saja!</strong></h3>\r\n<p>Satu hal yang pasti, Aries benci basa-basi. Mereka menganggap ini hanya akan membuang waktu mereka yang berharga.</p>\r\n<p>Jika ingin putus dengan si domba, langsung saja sampaikan tanpa obrolan panjang dan berbelit-belit. Iya, akan menyakitkan seperti mencabut bulu ketiak tetapi percayalah, mereka lebih memilih seperti ini.</p>\r\n<h3><strong>2. Taurus - Tangani dengan perlahan</strong></h3>\r\n<p>Sebagai pribadi yang menyukai kestabilan, Taurus cenderung kurang bisa menangani perpisahan dengan baik.</p>\r\n<p>Di saat sudah nyaman, mereka sulit menerima perubahan dan berjuang keras agar hubungan bisa bertahan. Anda perlu ekstra sabar dan empati untuk mengakhiri hubungan dengan si banteng ini.</p>\r\n<p>Apa yang perlu disiapkan?</p>\r\n<p>Pertama, makanan favorit atau&nbsp;<em>comfort food</em>&nbsp;kesukaannya. Kedua, siapkan daftar alasan yang mendukung keputusan Anda untuk putus. Taurus bukan seorang yang begitu saja menerima keputusan Anda begitu saja. Protes dan menantang argumen Anda adalah \'jalan ninja\' mereka.</p>\r\n<h3><strong>3. Gemini - Butuh obrolan panjang</strong></h3>\r\n<p>Tidak seperti Aries yang&nbsp;<em>to the point</em>, berhadapan dengan Gemini berarti Anda perlu bersiap untuk obrolan yang super panjang. Mengakhiri hubungan dengan pidato perpisahan jelas bukan ide baik.</p>\r\n<p>Gemini perlu penjelasan panjang lebar dan menyeluruh demi memahami keputusan Anda. Jika semua selesai dengan jelas, jarang memendam perasaan buruk terhadap Anda.</p>\r\n<h3>4. Cancer - Berikan waktu</h3>\r\n<p style=\"text-align: center;\">Ingin mengakhiri hubungan dengan Cancer artinya Anda musti siap dengan lebih dari satu sesi percakapan. Cancer cenderung emosional sehingga perlu waktu untuk memproses kabar buruk.</p>\r\n<p style=\"text-align: center;\">Setelah obrolan pertama, berikan dia waktu untuk memprosesnya dalam pikiran. Kemudian dalam percakapan berikutnya, berikan dia giliran untuk menyampaikan pemikirannya.</p>\r\n<h3>5. Leo - Perlindungan harga diri</h3>\r\n<ul>\r\n<li>Siapa yang mau dicampakkan? Ini jelas bisa mencoreng harga diri Leo. Singa ini hanya ingin mendengar \'<em>Bukan kamu, ini soal aku!</em>\' yang mengindikasi perpisahan ini adalah salah Anda.</li>\r\n<li>Hanya saja, jika itu bukan persoalannya, sebaiknya sampaikan keputusan untuk berpisah secara perlahan dan selembut mungkin. Ingatkan akan kualitas terbaik si dia demi melunakkan suasana. Cara ini pun bisa melindungi harga diri Leo.</li>\r\n</ul>\r\n<h3>6. Virgo - Semua harus disiapkan</h3>\r\n<p>Jika Anda mencari orang yang tak suka kejutan, Virgo orangnya. <span style=\"background-color: #236fa1;\">Tengok saja</span>, selama menjalin hubungan dengannya pasti rencana kencan tersusun rapi. Bahkan Virgo pun sudah siap dengan rencana cadangan saat rencana awal tak berjalan sempurna.</p>\r\n<p>Sebelum menyampaikan keputusan, sampaikan padanya bahwa Anda ingin mendiskusikan sesuatu yang berat atau sulit. Tak bisa dimungkiri dia bakal berpikir macam-macam tapi setidaknya dia akan bersiap untuk berbagai kemungkinan arah pembicaraan.</p>', '1616860349 . hasil-dewa-kipas-vs-irene.jpg', '2021-03-27 15:52:29', '2021-03-27 15:52:29');
INSERT INTO `news` (`id`, `title`, `openingsentence`, `description`, `picture`, `created_at`, `updated_at`) VALUES
(20, 'Hari Paling Berdarah Kudeta Myanmar, 50 Orang Tewas Sehari', 'Jakarta, CNN Indonesia -- Pasukan keamanan Myanmar disebut menembak dan menewaskan sedikitnya 50 pengunjuk rasa yang menentang kudeta militer di jalan-jalan Yangon, Mandalai dan kota-kota lainnya pada Sabtu (27/3).', '<p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-top: 16px; margin-bottom: 20px;\"><span style=\"color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Ini menjadi hari </span>paling<font color=\"#333333\" face=\"CNNSansW04-Regular, Arial, Helvetica, Tahoma\"><span style=\"font-size: 14px;\"> berd<b>arah sej</b>ak kudeta militer pada 1 Februari lalu.</span></font></p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><b>Ironisnya, tin</b>dakan brutal itu dilakukan saat para jenderal negara tersebut merayakan Hari Angkatan Bersenjata.</p><div class=\"parallax_detail parallaxB\" style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px; position: relative; margin: 0px auto !important;\"><div class=\"parallax_abs\" style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; width: 430px;\"><div class=\"parallax_fix\" style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; width: 430px;\"><div class=\"parallax_ads\" style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; width: 430px;\"></div></div></div></div><p><br style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"></p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-size: 14px;\"><span style=\"font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma;\">\"Hariini adalah hari yang m<u>emalu</u>kan bagi angkata</span><img src=\"data:image/jpeg;base64,\" data-filename=\"TTD Fachri.jpg\" style=\"width: 949px;\"><span style=\"font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma;\">n bersenjata,\" kata Sasa, juru bicara CRPH, kelompok anti-junta yang dibentuk oleh anggota parlemen yang digulingkan, kepada s</span><font face=\"Impact\">ebua</font><font face=\"CNNSansW04-Regular, Arial, Helvetica, Tahoma\">h forum online seperti dilansir&nbsp;</font><em style=\"font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; -webkit-font-smoothing: antialiased; backface-visibility: hidden;\">Reuters</em><font face=\"CNNSansW04-Regular, Arial, Helvetica, Tahoma\">.</font></p><h3 style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">asdasd</h3><ul><li style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Sementara di Mandalay, tiga belas orang tewas dalam berbagai insiden. Kematian juga dilaporkan dari wilayah Sagaing dekat Mandalay, kota Lashio di timur, di wilayah Bago, dekat Yangon, dan tempat lain.</li><li style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Seorang juru bicara militer belum memberikan konfirmasi terkait dengan laporan-laporan tersebut.</li><li style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Sementara itu, usai memimpin parade militer di ibu kota Naypyitaw untuk memperingati Hari Angkatan Bersenjata, Jenderal Senior Min Aung Hlaing hanya menegaskan kembali janjinya untuk mengadakan pemilihan tanpa memberi tahu kapan rencana itu akan direalisasikan.</li></ul><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">\"Tentara berusaha untuk bergandengan tangan dengan seluruh bangsa untuk menjaga demokrasi,\" kata jenderal tersebut dalam siaran langsung di televisi pemerintah.</p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br></p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Ia juga menambahkan bahwa pihak berwenang juga berusaha untuk melindungi rakyat dan memulihkan perdamaian di seluruh Myanmar. \"Tindakan kekerasan yang mempengaruhi stabilitas dan keamanan dalam unjuk rasa tidak pantas,\" ujarnya.</p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\">Kelompok pemantau Asosiasi Bantuan untuk Tahanan Politik melaporkan sedikitnya 330 orang tewas dalam demonstrasi menentang kudeta, termasuk sejumlah besar yang terbunuh oleh tembakan langsung dari pasukan keamanan. Sementara lebih dari 3.000 lainnya ditangkap.</p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><br></p><p style=\"-webkit-font-smoothing: antialiased; backface-visibility: hidden; margin-bottom: 20px; color: rgb(51, 51, 51); font-family: CNNSansW04-Regular, Arial, Helvetica, Tahoma; font-size: 14px;\"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/Hmy-fnqBFTE\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>', '1616862951 . elon.jpg', '2021-03-27 16:01:47', '2021-03-27 16:35:51');

